import React, { Component } from 'react';
import { Redirect, withRouter } from 'react-router-dom';
import { connect } from 'react-redux';
import { Button, Card, CardDeck, Image, Container } from 'react-bootstrap';
import 'bootstrap/dist/css/bootstrap.min.css';
import "./components.css";

import {Helmet} from "react-helmet";



class Home extends Component {

  constructor(props) {
    super(props);

  }


  render() {
    return (
      <div style={{ alignItems: "center" }}>

          <div className="header">足球集锦之家⚽</div>

          <div>最新比赛集锦</div>
          <Container fluid className="highlights-container"></Container>

        <Helmet>
          <meta name="description" content="Have Some Company While You're Becoming Your Better Self"></meta>
          <title>Salon</title>
        </Helmet>

      </div>
    );
  }
}



export default Home;
